(2438, 'authenticator_set', '', 'Set up an account: To set up an account with Google Authenticator and scan the QR code provided with the Google Authenticator app.', 'Настроить учетную запись: настроить учетную запись с помощью Google Authenticator и отсканировать QR-код, предоставленный с приложением Google Authenticator.'),
(2439, 'authenticator_verify', '', 'Verify your account: After you\'ve set up your account, you\'ll be asked to enter a Confirmation Code (OTP) generated by Google Authenticator to verify your account. Simply open the app, find the account you set up, and enter the OTP when prompted.', 'Подтвердите свою учетную запись: после того, как вы настроили свою учетную запись, вам будет предложено ввести код подтверждения (OTP), сгенерированный Google Authenticator, для подтверждения вашей учетной записи. Просто откройте приложение, найдите созданную вами учетную запись и введите одноразовый пароль при появлении запроса.'),
(2440, 'authenticator_otp', '', 'Use the OTP: Whenever you sign in to your account, you\'ll be asked for both your password and an OTP generated by Google Authenticator. Simply open the app, find the account you set up, and enter the OTP when prompted.', 'Используйте одноразовый пароль: всякий раз, когда вы входите в свою учетную запись, вам будет предложено ввести пароль и одноразовый пароль, сгенерированный Google Authenticator. Просто откройте приложение, найдите созданную вами учетную запись и введите одноразовый пароль при появлении запроса.'),
